import "../styles/Card.css";
import { NavLink } from "react-router-dom";

function Card(props) {
	const titre = props.infos.name;
	const image = props.infos.image;
	const description = props.infos.description;
	const date = props.infos.date;
	const url = props.infos.url;

	return (
		<a href={url}>
			<div class="card">
				<figure class="hexagon">
					<div class="hexagon_top">
						<h1 className="h1Card">{titre}</h1>
					</div>
					<div class="hexagon_bottom">
						<p>{description}</p>
						<img src={image} alt="" />
					</div>
				</figure>
			</div>
		</a>
	);
}

export default Card;
